import React from "react";
const Login = () => {
  return (
    <div className="container">
      <div className="row mt-5 ms-5" style={{ height: "70vh" }}>
        <div className="col-4 border border-4 mt-3">Full Image</div>
        <div className="col-7 border border-4 mt-3">
          <h2 className="text-center">Login</h2>
          <div className="row">
            <section
              className="d-flex justify-content-evenly pt-2"
              style={{ color: "black" }}
            >
              <a href="!#">
                <i className="fab fa-google fa-3x"></i>
              </a>
              <a href="!#">
                <i className="fab fa-facebook fa-3x"></i>
              </a>
            </section>
          </div>
        </div>
      </div>
    </div>
  );
};
export default Login;
